import React, { useState, useEffect } from "react";
import "./States.css";

function States() {
  const [states, setStates] = useState([]);
  const [newState, setNewState] = useState({
    Name: "",
    Device: "",
    Condition: "",
    Parameter: "",
  });

  useEffect(() => {
    fetch("/states")
      .then((res) => {
        if (!res.ok) {
          throw new Error(`HTTP error ${res.status}`);
        }
        return res.json();
      })
      .then((data) => setStates(data))
      .catch((err) => console.error("Error fetching states:", err));
  }, []);

  const handleInputChange = (e) => {
    setNewState({ ...newState, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch("/states", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(newState),
    })
      .then((res) => {
        if (!res.ok) {
          throw new Error(`HTTP error ${res.status}`);
        }
        return res.json();
      })
      .then((data) => {
        setStates([...states, data]);
        setNewState({ Name: "", Device: "", Condition: "", Parameter: "" });
      })
      .catch((err) => console.error("Error submitting new state:", err));
  };

  return (
    <div className="states-page">
      <h1>States</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Device</th>
            <th>Condition</th>
            <th>Parameter</th>
          </tr>
        </thead>
        <tbody>
          {states.map((state) => (
            <tr key={state._id}>
              <td>{state.Name}</td>
              <td>{state.Device}</td>
              <td>{state.Condition}</td>
              <td>{state.Parameter}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <form onSubmit={handleSubmit}>
        <h2>Add State</h2>
        <div>
          <label htmlFor="state-name">Name:</label>
          <input
            type="text"
            id="state-name"
            name="Name"
            value={newState.Name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label htmlFor="device">Device:</label>
          <input
            type="text"
            id="device"
            name="Device"
            value={newState.Device}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label htmlFor="condition">Condition:</label>
          <input
            type="text"
            id="condition"
            name="Condition"
            value={newState.Condition}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label htmlFor="parameter">Parameter:</label>
          <input
            type="text"
            id="parameter"
            name="Parameter"
            value={newState.Parameter}
            onChange={handleInputChange}
            required
          />
        </div>
        <button type="submit">Add State</button>
      </form>
    </div>
  );
}

export { States };
